import React from "react";
import "../bulma/css/bulma.min.css";
import "../App.css";
import The_Olymp from "../images/olympian.jpeg";
import Dragon from "../images/dragon.jpeg";
import Skhokho from "../images/skhokho.jpeg";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const Case_Studies_Slider = () => {
  return (
    <div>
      <div class="column">
        <div className="Rectangle CaseColummn"> </div>
        <div className="font_WhatWeDo1 CaseColummn_Title">
          <p>Case Studies</p>
        </div>
        <div class="columns">
          <Carousel className="CarouselSlider">
            <div>
              <section class="hero has-bg-img-olympian">
                <div class="hero-body">
                  <p className="RegularText CarouselText1">The Olympian</p>
                  <p className="RegularTextCaseStudies CarouselText2">
                    The only athlete in the world to do her Olympic routine in
                    2020.
                  </p>
                </div>
              </section>
            </div>
            <div>
              <img src={Dragon} alt="Dragon" />
              <p className="legend">The Savings Jar</p>
              <p className="legend">
                Grow your savings treasure and grow your dragon.
              </p>
            </div>
            <div>
              <img src={Skhokho} alt="Skhokho" />
              <p className="legend">Skhokho seMali</p>
              <p className="legend">
                Helping South Africans become #CashCleva with Skhokho and
                TymeBank.
              </p>
            </div>
          </Carousel>
        </div>
      </div>
    </div>
  );
};

export default Case_Studies_Slider;

